import React from "react";
import Logo from "../../../../assets/images/Logo.jpeg";

const NavLogo = () => {
  return (
    <React.Fragment>
      <div className="navbar-brand header-logo mb-4">
        <img src={Logo} alt="Logo" width={225} height={70} />
      </div>
    </React.Fragment>
  );
};

export default NavLogo;
